  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alaska
  Maritime NWR (including the Alaska Peninsula Unit, the Aleutian Island Unit, the
  Chukchi Sea Unit, and the Gulf of Alaska Unit) outlines Refuge accomplishments during
  the 1983 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. The report includes a planning section which discusses the
  master plan, public participation, and research and investigations. Refuge administration
  is outlined; information about personnel, manpower programs, volunteer programs,
  funding, and safety is given. Habitat management is also covered; subjects include
  wetlands, grazing, and wilderness areas. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries resources,
  scientific collections, animal control, and marking and bird banding. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, trapping, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about rehabilitation, major maintenance, equipment replacement, communication
  systems, and energy conservation. Items of interest are provided at the end. Refuge
  brochures and field guides are attached.\",\n\t\"license_title\": \"License Not
